All I need is Chai and Sunshine ☀️ 

The only makeup products that travelled all the way to Kashmir ❄️✨🤍 it was -12* at Gulmarg and this is the makeup I did all 5 days ! 

@indewild lip treatment was a saviour for my chapped lips. Not just mine. My kids and hubby used it too 

@laneige_in milk toner, made my skin super hydrated no matter how cold it was 

@cerave I can’t stress how good this moisturiser is, it was literally over by the end of the trip. I used it on my kids too. All the dry patches disappeared the minute I apply this. If you are travelling to someplace cold or if you are living in a cold / winter area just get this one. 

@garnierindia @try.moody these are the two sunscreens I took with me. Both are very light weight. Very hydrated doesn’t move your makeup also no dryness on the skin. 

MAKEUP 

@smashboxindia tinted moisturiser is the only base product I got for this trip. 
I am not a huge foundation person, especially during cold minimal makeup is all you need. If you apply too many products it might create patches. 

@hudabeauty blush, shade choco one of the best shade. This works as your bronzer and as a blush. Long lasting. 

@hudabeauty mascara, this is so good. Enhanced my whole face. So many dmed me for what mascara I used. And it’s the one coat mascara from huda. 

@toofaced sell out lipstick @simplynam.beauty lip stick shade Priya 

Lastly for the glow on my skin I used @dalba_global truffle spray 

Dry shampoo @batiste_hair 
